// TODO: this should return actual <svg> elements so they can be themed
export function getWalletIcon(provider: string) {
  switch (provider) {
    case "google":
      return googleIconUri;
    case "coinbase":
      return coinbaseIconUri;
    case "apple":
      return appleIconUri;
    case "facebook":
      return facebookIconUri;
    case "phone":
      return phoneIcon;
    case "email":
      return emailIcon;
    case "passkey":
      return passkeyIcon;
    case "discord":
      return discordIconUri;
    case "line":
      return lineIconUri;
    case "x":
      return xIcon;
    case "farcaster":
      return farcasterIconUri;
    case "telegram":
      return telegramIconUri;
    case "twitch":
      return twitchIconUri;
    case "guest":
      return guestIcon;
    default:
      return genericWalletIcon;
  }
}
